import React, {Component} from "react"
import ActionDropdown from "./ActionDropdown";


export default class AdminTableRow extends Component
{
    constructor(props) {
        super(props)
    }



    render() {
        const {
            product_id,
            name,
            price,
            category,
            brand,
            current_stock,
            handleRowClick
        } = this.props.products;

        return (
            <tr onClick={handleRowClick}>
                <td>{this.props.rowNum}</td>
                <td>{name}</td>
                <td>{price}</td>
                <td>{category}</td>
                <td>{brand}</td>
                <td>{product_id}</td>
                <td>{current_stock}</td>
            </tr>
        )
    }
}
